const Memey = () => {
    return (
        <>
           <Link to= "/" style={{textDecoration: 'none', color: 'black'}}> <p>‚Üê Home</p> </Link>
           <div>
                <img src= '/Images/Meme.png' style={{width: '700px', height: '450px', display: 'flex', justifyContent: 'center'}}></img>
           </div>
        </>
    )
}

export default Memey
